import { useNavigate, Link } from "react-router-dom";
import { useState } from "react";

function Register() {
  const navigate = useNavigate();

  const [error, setError] = useState("");
  const [email, setEmail] = useState("");
  const [username, setUsername] = useState("");
  const [password, setPassword] = useState("");
  const [confirmPassword, setConfirmPassword] = useState("");

  const handleRegister = async () => {

    // Checking all fields are filled correctly

    // All fields are filled
    if (!email || !username || !password || !confirmPassword) {
      setError("All fields are required");
      return;
    }

    // Email is not valid
    const emailRegex = /^[^\s@]+@[^\s@]+\.[^\s@]+$/;
    if (!emailRegex.test(email)) {
      setError("Please enter a valid email address");
      return;
    }

    // Username is wrong length
    if (username.length < 2 || username.length > 64) {
      setError("Username must be between 2 and 64 characters");
      return;
    }

    // Password and confirm password don't match
    if (password != confirmPassword) {
      setError("Passwords do not match");
      return;
    }

    // Password is wrong length
    if (password.length < 8 || password.length > 64) {
      setError("Password must be between 8 and 64 characters");
      return;
    }

    // Password is not varied enough
    const passwordRegex = /^(?=.*[a-z])(?=.*[A-Z])(?=.*\d)(?=.*[!@#$%^&*()_+]).*$/
    if (!passwordRegex.test(password)) {
      setError("Password must contain uppercase letters, lowercase lettesr, at least one number and a special character");
      return;
    }

    // Sending registration request
    try {
      const response = await fetch("http://localhost:5000/api/register", { 
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify({ email, username, password }),
      });

      const data = await response.json();

      if (!response.ok) {
        alert(data.message || "Registration failed");
        return;
      }

      alert("Registration successful!");
      navigate("/planner"); 
    } catch (error) {
      console.error("Error registering:", error);
      setError("Network error.");
    }
  };

  return (
    <div style={{
      backgroundColor: "#dbeeff",
      border: "5px solid #003366",
      minHeight: "100vh",
      display: "flex",
      flexDirection: "column",
      justifyContent: "center",
      alignItems: "center",
      fontFamily: "Arial, sans-serif",
      textAlign: "center"
    }}>
        <h1>REGISTER ACCOUNT</h1>
        
        {/* Email input */}
        <input
            type="email"
            placeholder="Email"
            value={email}
            onChange={(e) => setEmail(e.target.value)}
            style={{
            marginTop: "20px",
            padding: "10px",
            fontSize: "16px",
            borderRadius: "6px",
            border: "1px solid #003366",
            width: "250px"
            }}
        />

        {/* Username input */}
        <input
        type="username"
        placeholder="Username"
        value={username}
        onChange={(e) => setUsername(e.target.value)}
        style={{
            marginTop: "20px",
            padding: "10px",
            fontSize: "16px",
            borderRadius: "6px",
            border: "1px solid #003366",
            width: "250px"
        }}
        />

        {/* Password input */}
        <input
        type="password"
        placeholder="Password"
        value={password}
        onChange={(e) => setPassword(e.target.value)}
        style={{
            marginTop: "20px",
            padding: "10px",
            fontSize: "16px",
            borderRadius: "6px",
            border: "1px solid #003366",
            width: "250px"
        }}
        />

        {/* Confirm Password Input */}
        <input
        type="password"
        placeholder="Confirm Password"
        value={confirmPassword}
        onChange={(e) => setConfirmPassword(e.target.value)}
        style={{
            marginTop: "20px",
            padding: "10px",
            fontSize: "16px",
            borderRadius: "6px",
            border: "1px solid #003366",
            width: "250px"
        }}
        />

        {/* Register Button */}
        <button
        onClick={handleRegister}
        style={{
            marginTop: "20px",
            padding: "12px 24px",
            backgroundColor: "#003366",
            color: "white",
            borderRadius: "6px",
            fontSize: "16px",
            cursor: "pointer"
        }}
        >
        Register
        </button>
    
        {/* Login link */}
        <p style={{ marginTop: "16px", fontSize: "14px" }}>
            <Link to="/" style={{
            color: "#003366",
            textDecoration: "underline",
            cursor: "pointer",
            fontWeight: "bold"
            }}>
            Already have an account? Login
            </Link>
        </p>

        {/* Error Message */}
        {error && (
          <p style={{ color: "red", marginTop: "10px", fontWeight: "bold" }}>
            {error}
          </p>
        )}
    </div>
  );
}

export default Register;
